INSERT INTO `zmkj_live_groupbuy` (`groupbuy_id`,`groupbuy_name`,`groupbuy_remark`,`start_time`,`end_time`,`validity`,`store_id`,`store_name`,`original_price`,`groupbuy_price`,`buyer_count`,`buyer_limit`,`buyer_num`,`groupbuy_intro`,`groupbuy_pic`,`groupbuy_pic1`,`publish_time`,`is_hot`,`is_open`,`city_id`,`area_id`,`mall_id`,`class_id`,`s_class_id`,`is_audit`) VALUES('1','仅售345元！可享俏江南原价500元储值卡1张！全国72家门店通兑！','仅售345元！可享俏江南原价500元储值卡1张！全国72家门店通兑！','1399878000','1431360000','1436630400','1','俏江南','500.00','345.00','10000','5',NULL,'<p>俏江南创立于2000年,首家餐厅在北京CBD国贸中心开业,品牌定位于服务城市核心商务区。2002年在上海开设了第一家非京区域的连锁餐厅,从此步入了跨区域连锁的时代。</p>
<p>专精于将中华经典美食与时尚现代设计的结合,体现在不断追求菜品的创新与融合,餐厅设计上标新立意,由国际级设计师量身定做,将中国古典的江南小桥流水进行西式设计,以中西合璧的餐厅环境,带来时尚、健康、高雅的就餐体验。</p>','1_04532212795183385.jpg','1_04532212870644310.jpg','1399877398','1','1','1','3','320','2','10','2');

